import { Menu, Container, Image } from 'semantic-ui-react';
import Link from 'next/link';


function Header() {
  return (
    <Menu fluid id="menu" inverted>
      <container text>
        <Link href="/">
          <Menu.Item header>

          </Menu.Item>
        </Link> 

      </container>
    </Menu>
  )
}

export default Header;
